import React, { useEffect, useState } from 'react';
import './Search.css';

const Search = () => {

    const [searchValue, setSearchValue] = useState<string>()

    useEffect(() => {
        console.log(searchValue)
    }, [searchValue])

    const handleSearch = (e:any) => {
        setSearchValue(e)
    }

    return (
        <div className='search-wrapper'>
            <label htmlFor="search-input">
                Podaj nazwÄ™ psa: 
            </label>
            <input type='text' id='search-input' onChange={(e:any)=>{handleSearch(e.target.value)}}></input>
            <button className='search-btn'>Wyszukaj</button>
        </div>
    );
}

export default Search;
